/*
 * K.O - 2019/11/08 - Claim Voucher function
 */
$smcT5.CustomScripts.ClaimVoucher = function claimvc(pool_id, vc_selector, non_dynamic, force_pull) {
    (function($){
        var DBW = $smcT5.tagHelpers.DBW;
        var DBC = $smcT5.tagHelpers.DBC;
        var CM = $smcT5.CookieManager;
        if(!window.$smcO5 && $){ // Requires jQuery
            DBW('Dynamic Codes: This function only works when an overlay is loaded.');
            return;
        }
        var RM = $smcO5.funcs.overlayRemove;
        vc_selector = vc_selector ? vc_selector : "smc-code";
        non_dynamic = non_dynamic ? non_dynamic : false;
        force_pull = force_pull ? force_pull : false;
        
        var cookieName = 'smc_dc_'+pool_id; // Changing this should reset all saved codes and overwrite them with new ones.
        var cookieLength = 60*60*24*31; // Save cookie for 31 days.
        var claim_endpoint = 'https://dc.smct.co/v2/claim?pool_id='+pool_id;
        
        if(force_pull || !CM.exists(cookieName)){
            // Pulling new code
            $.get(claim_endpoint).done(function claim(data){
                if(data.error){ // ERROR
                    DBW('Dynamic Codes: '+data.message);
                    RM();
                    return;
                }
                if(data.code){ // SUCCESS
                    DBC('Dynamic Codes: Code retrieved from server');
                    checkAndApply(data);
                }
                // Non existing pools
                if(data.code === "" && !data.dynamic){ // ERROR
                    DBC('Dynamic Codes: Non existing pool. Closing the overlay.');
                    RM();
                }
            });
        } else {
            try{
                var cookie = CM.read(cookieName);
                var dat = JSON.parse(atob(cookie));
                DBC('Dynamic Codes: Code retrieved from cookie');
                checkAndApply(dat, false);  
            }catch(e){
                DBW('Dynamic Codes: Could not decode cookie. Closing the overlay...');
                RM();
            }
        }
        // Code check and applying
        function checkAndApply(data, save_cookie){
            save_cookie = save_cookie===false ? save_cookie : true; // Default true
            if(!non_dynamic && !data.dynamic){
                DBW('Dynamic Codes: NON-Dynamic code present, closing the overlay.');
                RM();
                return;
            }
            // Setting up the code
            $smcO5.vars.vc = data.code;
            $(vc_selector).text(data.code);
            $('smc-cp').attr('data-clipboard-text', data.code);
            // Replace smc_vc cookie
            var smc_vc = JSON.parse($smcT5.CookieManager.read('smc_vc'))
            if(smc_vc){
                smc_vc.v = btoa(data.code);
                $smcT5.CookieManager.create('smc_vc', JSON.stringify(smc_vc), 0);
            }
            // Debug
            DBC('Dynamic Codes: Voucher code applied to the overlay.');
            // Saving the code for future use.
            if(save_cookie){
                var dat = btoa(JSON.stringify(data));
                CM.create(cookieName, dat, cookieLength);
                DBC('Dynamic Codes: Code has been saved to a cookie.');
            }
        }
    })($ || jQuery);
}

/*
 * K.O - 2019/11/08 - Check remaining vouchers.
 */
$smcT5.CustomScripts.RemainingVoucher = function remvc(pool_id, buffer) {
    buffer = buffer ? buffer : 100;
    var rem_endpoint = 'https://dc.smct.co/v2/remaining?pool_id='+pool_id;
    var displayOverlay = false;
    var DBC = $smcT5.tagHelpers.DBC;
    $.get(rem_endpoint).done(function claim(data){
        if(
            data && 
            data.approximateRemaining &&
            data.approximateRemaining > buffer
        ) displayOverlay = true;
        DBC('Remaining Voucher Updated "'+pool_id+'" to ' + displayOverlay);
        // Updating a global object
        if(!displayOverlay){ // Only update if false. Otherwise display as normal
            $smcT5.CustomScripts[pool_id] = displayOverlay;
        }
    });
}

