const addEvent = $smcT5.tagHelpers.basket.safeListener(
  "click",
  "smc-listener-added",
  () => {
    const addToCartElements = Array.from(
      document.querySelectorAll(".add-to-cart"),
    );
    return addToCartElements;
  },
  (event, target) => {
    const container = target.closest(".ec-box");
    const image = container?.querySelector("img")?.src;
    const title = container?.querySelector(".ec-box-header a")?.innerText;
    const price = container?.querySelector(
      ".ec-box-footer span.label",
    )?.innerText;
    return [{ image, title, price, quantity: 1 }];
  },
);

const syncBasket = () => {
  const products = Array.from(document.querySelectorAll("table#cart tbody tr"));
  if (products.length > 0) {
    return products.map((prod) => {
      const image = prod.querySelector(".image img")?.src;
      const title = prod.querySelector(".name a")?.innerText;
      const price = prod
        .querySelector(".price small")
        ?.innerText.split(": ")[1];
      const quantity = prod.querySelector(".qty input")?.value;
      return { image, title, price, quantity };
    });
  }
  return undefined;
};

